scriptlet.script:
try {
	var sql = "update ENA_ACTIVE_LABS set SERVER_LIST = '" + serverList + "', STORAGE = '" + storage + "' where SUBSCRIPTION = '" + subscriptionId + "'";
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

try {
	var sl = JSON.parse(serverList);
	var srvs = Object.keys(sl);
	var clones = srvs.map(function(i) {
		return sl[i]["cloneId"];
	});
	scriptletContext.put("clones",JSON.stringify(clones));
	scriptletResponse="success";
}
catch(Error) {
	scriptletResponse="failure";
	scripteltContext.put("FailureMessage",Error);
}

try {
	if(size.match(/^[0-9]+$/) != null) {
		var sl = JSON.parse(serverList);
		var srvs = Object.keys(sl);
		var servers = srvs.filter(function(i) {
			return  sl[i]["cloneId"] == cloneId;
		});


		var tmp = sl[servers[0]];
		tmp["storage"] = size;
		sl[servers[0]] = tmp;
		scriptletContext.put("serverList",JSON.stringify(sl));
		scriptletContext.put("SERVER",servers[0]);

		var storage = scriptletContext.get("storage");
		if(storage != undefined) {
			storage = parseInt(storage);
			storage += parseInt(size);
		}
		else {
			storage = parseInt(size);
		}
		scriptletContext.put("storage",storage);
	}
	scriptletResponse="success";
}
catch(Error) {
	scriptletResponse="failure";
	scriptletContext.put("FailureMessage",Error);
}
